-- DROP TABLE wvf_categories;

CREATE TABLE `wvf_categories` (
  `category_id` int(4) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(40) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL DEFAULT '',
  `sequence` int(2) NOT NULL DEFAULT '1',
  `rpeat` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `public` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `color` varchar(10) DEFAULT NULL,
  `background` varchar(10) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`category_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=34;


-- DROP TABLE wvf_event_users;

CREATE TABLE `wvf_event_users` (
  `event_id` int(11) DEFAULT NULL,
  `event_date` date DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=12 ROW_FORMAT=FIXED;


-- DROP TABLE wvf_events;

CREATE TABLE `wvf_events` (
  `event_id` int(8) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(64) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `category_id` int(2) NOT NULL DEFAULT '0',
  `resource_id` int(4) unsigned NOT NULL DEFAULT '1',
  `description` text CHARACTER SET latin1 COLLATE latin1_german1_ci,
  `venue` varchar(64) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `owner_id` int(6) unsigned DEFAULT NULL,
  `editor` varchar(32) NOT NULL DEFAULT '',
  `private` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `s_date` date DEFAULT NULL,
  `e_date` date NOT NULL DEFAULT '9999-00-00',
  `x_dates` text CHARACTER SET latin1 COLLATE latin1_german1_ci,
  `s_time` time DEFAULT NULL,
  `e_time` time NOT NULL DEFAULT '99:00:00',
  `r_type` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `r_interval` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `r_period` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `r_until` date NOT NULL DEFAULT '9999-00-00',
  `notify` tinyint(1) NOT NULL DEFAULT '-1',
  `not_mail` varchar(255) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `a_date` date NOT NULL DEFAULT '9999-00-00',
  `m_date` date NOT NULL DEFAULT '9999-00-00',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  `e_cost` decimal(11,0) DEFAULT NULL,
  `free` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`event_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=989 DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=138;


-- DROP TABLE wvf_resources;

CREATE TABLE `wvf_resources` (
  `resource_id` int(4) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(40) NOT NULL DEFAULT '',
  `sequence` int(2) unsigned NOT NULL DEFAULT '1',
  `teamsize_min` int(11) NOT NULL,
  `teamsize_max` int(11) NOT NULL,
  `rpeat` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `public` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `color` varchar(10) DEFAULT NULL,
  `background` varchar(10) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`resource_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=44;


-- DROP TABLE wvf_users;

CREATE TABLE `wvf_users` (
  `user_id` int(6) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `password` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `firstname` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `familyname` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `phone` varchar(20) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `temp_password` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `email` varchar(64) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL DEFAULT '',
  `sedit` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `privs` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `login_0` date NOT NULL DEFAULT '9999-00-00',
  `login_1` date NOT NULL DEFAULT '9999-00-00',
  `login_cnt` int(8) NOT NULL DEFAULT '0',
  `language` varchar(32) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `color` varchar(10) CHARACTER SET latin1 COLLATE latin1_german1_ci DEFAULT NULL,
  `status` enum('active','deleted') CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL DEFAULT 'active',
  `BSP_date` date DEFAULT NULL,
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=100 DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=130;


-- DROP TABLE wvf_users_resources;

CREATE TABLE `wvf_users_resources` (
  `user_id` int(11) DEFAULT NULL,
  `resource_id` int(11) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AVG_ROW_LENGTH=9 ROW_FORMAT=FIXED;


